import API from "../utils/api";
import React, {useState } from "react";
let test1=[];
let test2;
const HomePage= ()=>{
    const [myState,setState]=useState({
        firstName:"",
        lastName:"",
        gender:"",
        nat:""
    });
    API.seed()
    .then(res=>{
        const user=res.data;    
        const results=user.results.map(user=>{
            return{
                ...myState,
                firstName:user.name.first,
                lastName:user.name.first,
                gender:user.gender,
                nat:user.nat,
            }
        })   
        // .forEach(element=>test1.push((element.name.first))),
        // test2=test1.forEach(element=>console.log(element))
        // console.log(res.data.results)
        console.log(results);
    });
}
export default HomePage;
